releaseNotes:
New features:
	  - NOTENET-220 Rendering the tag elements;
	  - NOTENET-582 Add support to save attached files;
	  - NOTENET-699 Add support for table columns with locked width;
	  - NOTENET-700 Add support to save hyperlinks;
	  - NOTENET-704 Add support to save outline groups.
Enhancements:
	  - NOTENET-665 Improve OneNote to Pdf conversion performance for documents with missing fonts.
Fixed bugs:
	  - NOTENET-244 The size of tag element is not correct when the text has a big size;
	  - NOTENET-733 Public method GetChildNodes throws an exception when page doesn't have a title.
